import Day from "/Users/johanmathew/Documents/Web Design Folder/react-test/src/components/Date/Date"; 
import "./Calendar.css"; 

export default function Calendar () {

    const monthNames = ["January", "February", "March", "April", "May", "June",
    "July", "August", "September", "October", "November", "December"];

    let month = []; 

    let curr = new Date(Date.now()); 

    let currMonth = curr.getMonth();

    month.push(curr); 

    while(curr.getMonth() === currMonth || curr.getDay() >= 0) {
         month.unshift(new Date(curr)); 
         curr.setDate(curr.getDate() - 1); 

         console.log(curr.getMonth()); 
    }

    console.log(month[0]); 

    curr = new Date(Date.now()); 



    while(curr.getMonth() === currMonth && curr.getDay() < 7) {
        month.push(new Date(curr)); 
        curr.setDate(curr.getDate() + 1); 
    }

    console.log(monthNames[month[0].getMonth]); 

    let monthIndex = 0; 

